    data: |
      SELECT DISTINCT - cor2.col1 AS col0 FROM tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab1
  - name: tab2

outputs:
  - name: q6839.out
    data: |
      -10
      -13
      -26
